n// Document\n.scmp {\n\tline-height: font.$lh-sm; // Correct the line height in all browsers.\n\n\t// stylelint-disable-next-line property-no-vendor-prefix\n\t-webkit-text-size-adjust: 100%; // Prevent adjustments of font size after orientation changes in iOS.\n\n\tfont-family: font.$family;\n\tfont-size: font.$size-sm;\n\tfont-style: normal;\n\tfont-weight: font.$weight-normal;\n\ttext-align: left;\n\n\tcolor: color.$black;\n}\n\n.is-cw {\n\tcolor: color.$cw-fg-primary;\n}\n\n*,\n*::before,\n*::after {\n\tbox-sizing: border-box;\n}\n\nul {\n\tpadding-left: space.$md;\n}\n\ndd {\n\tmargin: 0;\n}\n\nb,\nstrong,\ndt,\n.bold {\n\tfont-weight: font.$weight-bold; // Add the correct font weight in Chrome, Edge, and Safari.\n}\n\n// Prevent `sub` and `sup` elements from affecting the line height in all browsers.\nsub,\nsup {\n\tposition: relative;\n\tvertical-align: baseline;\n\n\tline-height: 0;\n\n\tfont-size: 72%;\n\tfont-weight: 600;\n}\n\nsup {\n\ttop: -.5em;\n}\n\n// Tables\ntable {\n\tborder-collapse: collapse;\n\tborder-spacing: 0;\n}\n\n// Forms\nbutton,\ninput,\nselect,\ntextarea {\n\t// Apply (uncomment) next line within SIP-2238\n\t// margin: 0; // Remove the margin in Firefox and Safari.\n\toverflow: visible; // Show the overflow in Edge.\n\tline-height: font.$lh-sm; // Change the font styles in all browsers.\n\n\tfont-family: inherit; // Change the font styles in all browsers.\n\n\tfont-size: 100%; // Change the font styles in all browsers.\n\ttext-transform: none; // Remove the inheritance of text transform in Edge, Firefox, and IE.\n\n\toutline-color: color.$form-outline;\n}\n\ntextarea {\n\toverflow: auto;\n}\n\n// Correct the inability to style clickable types in iOS and Safari.\nbutton,\n[type="button"],\n[type="reset"],\n[type="submit"] {\n\tcursor: pointer;\n\t// stylelint-disable-next-line property-no-vendor-prefix\n\t-webkit-appearance: button;\n\n\t// Restore the focus styles unset by the previous rule.\n\t&:-moz-focusring {\n\t\toutline: 1px dotte